import React from 'react';

const Tab = ({name, imageSrc}) => {

    return (
        <div style={{
            backgroundColor : 'purple',
            width : '100%',
            height : '15vh',
            display:'flex',
            gap : '20px',
            justifyContent : "flex-start",
            flexDirection : "row",
            alignItems : 'center'
        }}>

            <img src={imageSrc} 
                style={{
                    width : "50px",
                    height : "50px"
                }}
            />
            <h3>{name}</h3>

        </div>
    )
}

export default Tab;
